import { FaTimes } from 'react-icons/fa'

const Team = ({ team, onDelete}) => {
  return (
    <div
      className={`team ${team.reminder && 'reminder'}`}
    >
      <h3>
        {team.teamName}{' '}
        <FaTimes
          style={{ color: 'red', cursor: 'pointer' }}
          onClick={() => onDelete(team.id)}
        />
      </h3>
    </div>
  )
}

export default Team
